import {
    Paper,
    Stack
} from "@mui/material"
import React from "react"

import { colors } from "../../utils/CustomTheme"

const Header = () => {
    return (
        <Stack sx={{ height: 70, marginBottom: 30, borderBottom: `1px dtted ${colors.saffron}` }}>
            <Paper>
                HEADER
            </Paper>
        </Stack>
    )
}
export default Header
